/* eslint-disable jsx-a11y/iframe-has-title */
import React, { Component } from "react";
import '../../css/Home.scss';
import '../../css/Home.sass';
import Footer from "../../global/Footer";
import sample from '../../../videos/intro.mp4';
// import Modal from "../global/Modal";
import JunctionLogo from '../../../images/junction_img/JunctionX_logos_white.png'
import JunctionL from '../../../images/junction_img/junctionx_globe_black.svg'
import JunctionR from '../../../images/junction_img/junctionx_globe_white.svg'
import JunctionCollab from '../../../images/junction_img/junctionx_2020_collab.jpg'

// import Mentor images
import Mark from '../../../images/JxSingapore2019/mentor_img/mark_lven_palejaro.JPG'
import Jackie from '../../../images/JxSingapore2019/mentor_img/jackie.JPG'
import Marie from '../../../images/JxSingapore2019/mentor_img/marie_wong.jpeg'
import Eric from '../../../images/JxSingapore2019/mentor_img/eric_chang.jpg'
import Weihan from '../../../images/JxSingapore2019/mentor_img/weihan.jpg'
import Jed from '../../../images/JxSingapore2019/mentor_img/jed.jpeg'
import Satoshi from '../../../images/JxSingapore2019/mentor_img/satoshi.jpg'
import Yash from '../../../images/JxSingapore2019/mentor_img/yash_datta.jpeg'
import Ahmed from '../../../images/JxSingapore2019/mentor_img/ahmed_amer.jpeg'
// import Do from '../../../images/JxSingapore2019/mentor_img/Do_Hoang_Giang.jpg'
import Jeff from '../../../images/JxSingapore2019/mentor_img/Jeff_Guo_Qing.png'
// import Jingchang from '../../../images/JxSingapore2019/mentor_img/Jingchang_Zhang.JPG'
import Liang from '../../../images/JxSingapore2019/mentor_img/Liang_Jingxi.jpg'
import Phan from '../../../images/JxSingapore2019/mentor_img/Phan_Huy_Nguyen.jpg'

// JunctionXAsia
import JunctionAsiaPoster from '../../../images/JxAsia2020/JunctionX_2020_intro.jpg'
import JunctionAsiaLogo1 from '../../../images/JxAsia2020/junctionx_asia_white_oneline.png'

// For Router History
import { useHistory } from 'react-router-dom';

// Imported JSX Components
import JxSingapore2019Stats from '../events/JxSingapore2019/JxSingapore2019Stats'

// Company Photos
import RakutenImg from '../../../images/JxSingapore2019/partners_img/Rakuten.png'
import ShopeeImg from '../../../images/JxSingapore2019/partners_img/Shopee.png'
import KasperskyImg from '../../../images/JxSingapore2019/partners_img/kaspersky.png'
import RakutenRapidApiImg from '../../../images/JxSingapore2019/partners_img/RakutenRapidAPI.png'
import RedBullImg from '../../../images/JxSingapore2019/partners_img/Redbull_logo.png'
import StartupX from '../../../images/JxSingapore2019/partners_img/startupx1.jpeg'

import {Link} from 'react-router-dom'


class Home extends Component {
    

  constructor(...args) {
    super(...args);
    this.state = { showModal: false };

    this.close = () => {
      this.setState({ showModal: false });
    };

    this.open = () => {
      this.setState({ showModal: true });
    };

  }

  componentWillMount(){
    this.open();
  }

  

  render() {
    
    console.log(this.state.showModal)
    return (
      <div>
        <div className = "container">
        <div className = "wrapperOne">
          <video className='videoTag' autoPlay loop muted>
            <source src={sample} type='video/mp4' />
            <h1>hello</h1>
          </video>
          <div className = "containerOne">
            <img className = "logoSize" src={JunctionLogo} alt= "JunctionLogo"/>
            <p className = "headerLogo">JUNCTIONX SINGAPORE</p>
            {/* <img src={JunctionAsiaLogo1} className="headerLogoImg" ></img> */}
            <p>HACK THE FUTURE</p>
            <div style={{fontSize: 15 +"px"}} className = "textTwo color">Empowering the Future with Tech </div>
          </div>
        </div>
        <div className = "wrapperTwo">
          <div className = "containerTwo">
            <div className='textColor'>ABOUT</div>
            <div>
              <div className="textOne">JunctionX Singapore</div>
              <div className="textTwo subconOne">
                <div>
                  JunctionX Singapore is part of the global junctionX team which started off in Helsinki, Finland.
                  We are a volunteer community of tech enthusiasts who work with the industry to craft out a one of a kind hackathons for people in Singapore, as well as the region.
                </div>
                  In our hackathons, we bring together developers, designers and other tech-minded people to create new projects and solve intriguing challenges.
                <div>

                </div>
                <div>

                    In order to offer our participants the most stimulating problems and latest technology, we partner with roughly companies like Rakuten and Shopee.
                </div>
                <div>
                  We believe that technology is a powerful tool when used right, and everybody should have the possibility to build meaningful things with it: that's why all of our events are centered around learning and creating with technology.
                </div>
                <br></br>
                <div>Hack the Future with us! See you for our next event!</div>
              </div>
              <div className="subconTwo">
                {/* <img src={JunctionAsiaPoster} /> */}
                <iframe src="https://www.youtube.com/embed/c7SoIr0I2Qg" frameBorder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>
              </div>
            </div>
          </div>
        </div>
        <div className = "wrapperThree">
            <div className = "containerThree">
                <div>hello</div>
            </div>
        </div>
        <div className = "wrapperFour">
            <div>hello</div>
        </div>
        <div className = "wrapperThree" >
          <div>hello</div>
        </div>
        <div className = "wrapperFour" >
           <div>hello</div>
        </div>
        <div className = "wrapperThree" >
          <div>ds</div>
        </div>
        <Footer />
    </div>
  </div>
    );
  }
}

export default Home;
